import React, { useEffect, useState } from "react";
import "../../App.scss";
import "./Search.scss";
import Footer from "../../components/Footer/Footer";
import { Link } from "react-router-dom";

const Search = () => {
  const [models, setModels] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [filteredModels, setFilteredModels] = useState([]);
  const [debouncedSearchTerm, setDebouncedSearchTerm] = useState("");
  const [showNotFound, setShowNotFound] = useState(false);
  const [isLoading, setIsLoading] = useState(false); // ðŸŒŸ ÐÐ¾Ð²Ð¾Ðµ ÑÐ¾ÑÑ‚Ð¾ÑÐ½Ð¸Ðµ Ð´Ð»Ñ Ð»Ð¾Ð°Ð´ÐµÑ€Ð°

  // ðŸŒŸ Debounce Ð´Ð»Ñ Ð·Ð°Ð´ÐµÑ€Ð¶ÐºÐ¸ Ð² 2.5 ÑÐµÐºÑƒÐ½Ð´Ñ‹
  useEffect(() => {
    const handler = setTimeout(() => {
      setDebouncedSearchTerm(searchTerm);
    }, 2500);

    return () => {
      clearTimeout(handler);
      setShowNotFound(false);
    };
  }, [searchTerm]);

  // ðŸŒŸ Ð—Ð°Ð¿Ñ€Ð¾Ñ Ð½Ð° ÑÐµÑ€Ð²ÐµÑ€ Ð¿Ñ€Ð¸ Ð¸Ð·Ð¼ÐµÐ½ÐµÐ½Ð¸Ð¸ debouncedSearchTerm
  useEffect(() => {
    const fetchModels = async () => {
      try {
        if (debouncedSearchTerm.trim() !== "") {
          setIsLoading(true); // ðŸŒŸ ÐŸÐ¾ÐºÐ°Ð·Ñ‹Ð²Ð°ÐµÐ¼ Ð»Ð¾Ð°Ð´ÐµÑ€ Ð¿ÐµÑ€ÐµÐ´ Ð·Ð°Ð¿Ñ€Ð¾ÑÐ¾Ð¼
          const response = await fetch("http://127.0.0.1:8000/models/main/");
          if (!response.ok) throw new Error("Failed to fetch models");

          const data = await response.json();
          setModels(data.results);
        } else {
          setModels([]);
        }
      } catch (error) {
        console.error("Error fetching models:", error);
      } finally {
        setIsLoading(false); // ðŸŒŸ Ð¡ÐºÑ€Ñ‹Ð²Ð°ÐµÐ¼ Ð»Ð¾Ð°Ð´ÐµÑ€ Ð¿Ð¾ÑÐ»Ðµ Ð·Ð°Ð²ÐµÑ€ÑˆÐµÐ½Ð¸Ñ Ð·Ð°Ð¿Ñ€Ð¾ÑÐ°
      }
    };

    fetchModels();
  }, [debouncedSearchTerm]);

  // ðŸŒŸ Ð¤Ð¸Ð»ÑŒÑ‚Ñ€Ð°Ñ†Ð¸Ñ Ð¼Ð¾Ð´ÐµÐ»ÐµÐ¹
  useEffect(() => {
    if (debouncedSearchTerm.trim() !== "") {
      const filtered = models.filter((model) =>
        model.full_name
          .toLowerCase()
          .includes(debouncedSearchTerm.toLowerCase())
      );
      setFilteredModels(filtered);

      if (filtered.length === 0) {
        setTimeout(() => setShowNotFound(true), 4000);
      } else {
        setShowNotFound(false);
      }
    } else {
      setFilteredModels([]);
      setShowNotFound(false);
    }
  }, [debouncedSearchTerm, models]);

  return (
    <>
      <div className="search-page">
        <div className="top-bar">
          <div className="top-bar__navigation top-bar__navigation-person">
            <nav className="top-bar__nav top-bar__nav-person">
              <ul className="top-bar__list top-bar__list-person">
                <li className="top-bar__item top-bar__item-person">
                  <Link to="/woman" className="top-bar__link">
                    Women
                  </Link>
                </li>
                <li className="top-bar__item top-bar__item-person">
                  <Link to="/man" className="top-bar__link">
                    Man
                  </Link>
                </li>
                <li className="top-bar__item top-bar__item-person">
                  <Link to="/newsletter" className="top-bar__link">
                    Newsletter
                  </Link>
                </li>
                <li className="top-bar__item top-bar__item-contact top-bar__item-person">
                  <Link to="/contact" className="top-bar__link">
                    Contact
                  </Link>
                </li>
              </ul>
            </nav>
          </div>
        </div>

        <div className="top-bar__search-container-second top-bar__search-container-second__search">
          <div className="top-bar__search-elements-second">
            <div className="top-bar__search-icon-second">
              <img
                src="/icons/header/search.svg"
                alt="search"
                className="top-bar__search-item"
              />
            </div>
            <input
              type="text"
              placeholder="Search Model"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="top-bar__search-input"
            />
          </div>
        </div>

        <main className="main">
          <section className="our-models man-models">
            <div className="our-models__block">
              {isLoading ? (
                <div className="loader">Loading...</div> // ðŸŒŸ Ð›Ð¾Ð°Ð´ÐµÑ€
              ) : filteredModels.length > 0 ? (
                filteredModels.map((model, index) => (
                  <Link
                    to={`/models/main/${model.id}`}
                    key={index}
                    className="our-models__link"
                  >
                    <div className="our-models__card">
                      <div className="our-models__img">
                        <img
                          src={model.image_url}
                          alt={model.full_name || "Model"}
                        />
                      </div>
                      <div className="our-models__info">
                        <div className="our-models__name">
                          {model.full_name || "Loading..."}
                        </div>
                        <div className="our-models__location">
                          {model.city || "City"}, {model.country || "Country"}
                        </div>
                      </div>
                    </div>
                  </Link>
                ))
              ) : (
                showNotFound && <p className="no-results">No results found</p>
              )}
            </div>
          </section>
        </main>
      </div>

      <Footer />
    </>
  );
};

export default Search;
